CREATE TABLE `compra` (
  `idCompra` int(11) NOT NULL,
  `idCoche` int(11) NOT NULL,
  `idPlaza` int(11) NOT NULL,
  `fechaInicio` timestamp NULL DEFAULT current_timestamp(),
  `fechaFin` timestamp NULL DEFAULT NULL,
  `importe` float NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
-- Disparadores `compra`
--
DELIMITER $$
CREATE TRIGGER `actualizar_estado_plaza` AFTER INSERT ON `compra` FOR EACH ROW BEGIN
    UPDATE plaza SET estado = 'O' WHERE idPlaza = NEW.idPlaza;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `actualizar_estado_plaza_salida` AFTER UPDATE ON `compra` FOR EACH ROW BEGIN
    IF NEW.fechaFin IS NOT NULL THEN
        UPDATE plaza SET estado = 'L' WHERE idPlaza = NEW.idPlaza;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `calcularImporte` BEFORE UPDATE ON `compra` FOR EACH ROW BEGIN
    DECLARE minutos INT;
    DECLARE precio DECIMAL(10,2);
    
    SET minutos = TIMESTAMPDIFF(MINUTE, NEW.fechaInicio, NEW.fechaFin);
    
    IF minutos < 1 THEN
        SET precio = 3;
    ELSE
        SET precio = minutos * 3;
    END IF;
    
    SET NEW.importe = precio;
END
$$
DELIMITER ;

